import { useState } from "react";

const MovieRequest = () => {
    const [movies, setMovies] = useState([]);
    return(
        <div>
            <button>
                Carregar Filmes
            </button>
            <div>
                total de Filmes: {movies.length} 
            </div>
        </div>
    );

}
export default MovieRequest
